import React from "react";
import Banner from "../Components/common/Banner";
import FistikliBaklavalar from "../Components/common/FistikliBaklavalar";
import OwlCarouselVideo from "../Components/common/OwlCarouselVideo";

function FistikliBaklavalarPage() {
  return (
    <>
      <Banner />
      <FistikliBaklavalar />
      <OwlCarouselVideo />
    </>
  );
}

export default FistikliBaklavalarPage;
